import React from "react";
import "../styles/Footer.css";

function Footer() {
  return (
<footer>
  <p>© 2025 Made with ❤️ by Zainab</p>
  <div className="social-links">
    <a href="#">Github</a>
    <a href="#">LinkedIn</a>
    <a href="#">Socials</a>
  </div>
</footer>


  );
}

export default Footer;
